import React, { Component } from 'react';
import Search from './components/search'
import './App.css';
import { Provider } from './context'
class App extends Component {
  render() {
    return (
      <Provider>
      <div className="App">
       <Search />
      </div>
      </Provider>
    );
  }
}

export default App;
